import React from "react";
import { headphones } from "./Headphones";

export const Headphone = ({ match }) => {
  const headphone = headphones.find(
    ({ id }) => id === match.params.headphoneId
  );
  return (
    <div>
      headphones
      {headphone.brand}
    </div>
  );
};
